import React from 'react'

function Achievements() {
  return (
    <div className="w-full h-full bg-slate-700 rounded-3xl flex flex-col just">
      <h1 className="text-6xl font-[HolidayFree] text-white">Achievement's</h1>
      <h1 className="text-6xl font-[HolidayFree] text-white">
        Journey OF Mine...
      </h1>
    </div>
  );
}

export default Achievements
